content:
오늘 킬포!!&gt;&lt;
1.세모랑 세이 귀여웡!!&gt;~&lt;
2.진짜 세모의 꿈인줄 알았던 나...
3.세이 첫사랑 태권도 관장님인줄 알았던 나...
4.세모 얼굴 빨개졌데여!!&gt;&lt;꺄항

ㅇㄴ 백혈병이 전염 되는걸 믿는게 더 에바야;;
내가 초딩 때도 안걸 왜 몰라...???????????
그리고 전염 되면 세이는 학교 못 나오지 멍충이들아ㅠㅠㅠ
아픈데 학교를 어케 나오니,,,,ㅎㅎㅎㅎㅎㅎㅎㅎㅎ
진짜 머리 똑띠 달고 있으면 생각 좀 똑띠해라 얘들아ㅠㅠ;;

아니 말이랑 표정이 맞게라도 해보던가;;
말은 자기 괴롭혔다면서 표정은 왜 웃고있냐?
그리고 합성을 할꺼면 좀 티가 안나게라도 하던가 누가봐도 합성사진이구만;;

의사도 쓰레기네;;
그거를 슬픈 애앞에서 꼭 말해야됐냐;;
그나저나 세이가 퇴원한건 다행인데ㅠㅠ
언니는 어떡하냐ㅠㅠㅠㅠ

오는 세이 머리 이뿌다냐&gt;&lt;
아... 언니.. 이렇개 만나다니 넘좋운대?
세이/언니:오잉?
이거 넘좋아&gt;&lt;

61화에서 나온 할매아버지와의 회상씬에 나온 

&quot;&quot; 아무리 똘똘하다케도 즈그들이멘날봐가익숙한건자연스레흘리게되어있다&quot;&quot; 
&quot;&quot; 니보다 잘난것들을 잡을라면 ...&quot;&quot; &quot;&quot; &gt;&gt;&gt; 익숙하게도 시체( 당연히 죽어서 움직이지 않는..그리고 살아있지않을꺼라는 ...) 로 위장하고 &quot;중상자&quot; 로 움직임유발해서 주의를 끌고 유인하고  .. 적의 움직임을 유도해 ....적을 역공격.... 이라는거네요 ..

첫베댓 말하는 거 좀 어이가;;
오만은 보통 자기가 강하다, 높다 생각해서 방심하는 거 아닌가?
말하고자하는 게 뭔지는 알겠는데, 적절하지 못한 단어임

나빛세인줄;;;;
그내도 완전 재미있을듯?
최웹 강추

뭐지....불길하닷!!ㅎㄷㄷ
저 여자 눈치없네 으이구@.@;;
재수없다ㅋㅋ
